import React from "react";
import Farmer1 from "..//../assets/FarmersSliding.jpg";

function Sliding() {
  return (
    <div>
      {/* background Screen */}
      <div>
        <div>
          <div className="">
            <div className="">
              <img
                className="h-[600px] w-full sm:w-[600px] md:w-[800px] lg:w-[1200px] xl:w-[1600px]"
                src={Farmer1}
                alt="farmer"
              />
            </div>
            <div>
              <button className="text-center" onClick>
                Get Started
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Sliding;
